import classes from "./ThumbImage.module.css";

function ThumbImage(props) {
  const changeImage = () => {
    console.log(" inchange");
    props.onImageChangeHandler(props.source);
  };
  return (
    <div className={`${classes.th}`} onClick={changeImage}>
      <img
        className={classes.thumb}
        src="https://images.unsplash.com/photo-1567581935884-3349723552ca?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=774&q=80aG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=580&q=80"
      />
    </div>
  );
}

export default ThumbImage;
